import React, { useState } from 'react';
import { AppBar, Toolbar, Button, Box, Container, IconButton, Drawer, List, ListItem, useScrollTrigger } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { Link, useLocation } from 'react-router-dom';

const Navbar = () => {
  const [mobileOpen, setMobileOpen] = useState(false);
  const location = useLocation();
  const trigger = useScrollTrigger({
    disableHysteresis: true,
    threshold: 0,
  });

  const menuItems = [
    { text: 'Client Gallery', link: '/gallery' },
    { text: 'Store', link: '/store' },
    { text: 'Website', link: '/website' },
    { text: 'Studio Manager', link: '/studio' },
    { text: 'Mobile App', link: '/mobile' },
  ];

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const isActive = (path) => location.pathname === path;

  return (
    <AppBar 
      position="sticky" 
      elevation={trigger ? 1 : 0} 
      sx={{ 
        bgcolor: 'background.default',
        borderBottom: trigger ? 'none' : '1px solid',
        borderColor: 'grey.200'
      }}
    >
      <Container maxWidth="lg">
        <Toolbar sx={{ justifyContent: 'space-between', py: 1 }}>
          <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
            <Box 
              component="img" 
              src="/logo.png" 
              alt="Pixieset" 
              sx={{ 
                height: 32,
                '&:hover': {
                  opacity: 0.8
                }
              }} 
            />
          </Link>

          {/* Desktop Menu */}
          <Box sx={{ display: { xs: 'none', md: 'flex' }, gap: 1, alignItems: 'center' }}>
            {menuItems.map((item) => (
              <Button
                key={item.text}
                component={Link}
                to={item.link}
                color="primary"
                sx={{
                  px: 2,
                  py: 1,
                  position: 'relative',
                  '&::after': {
                    content: '""',
                    position: 'absolute',
                    bottom: 0,
                    left: 0,
                    width: '100%',
                    height: 2,
                    bgcolor: 'primary.main',
                    transform: isActive(item.link) ? 'scaleX(1)' : 'scaleX(0)',
                    transition: 'transform 0.3s ease-in-out',
                  },
                  '&:hover::after': {
                    transform: 'scaleX(1)',
                  }
                }}
              >
                {item.text}
              </Button>
            ))}
            <Button
              variant="contained"
              color="primary"
              sx={{
                ml: 2,
                px: 3,
                py: 1,
                '&:hover': {
                  transform: 'translateY(-2px)',
                  transition: 'transform 0.2s ease-in-out',
                }
              }}
            >
              Get Started
            </Button>
          </Box>

          {/* Mobile Menu Icon */}
          <IconButton
            color="primary"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ display: { md: 'none' } }}
          >
            <MenuIcon />
          </IconButton>
        </Toolbar>
      </Container>

      {/* Mobile Drawer */}
      <Drawer
        variant="temporary"
        anchor="right"
        open={mobileOpen}
        onClose={handleDrawerToggle}
        sx={{ 
          display: { xs: 'block', md: 'none' },
          '& .MuiDrawer-paper': { 
            width: 280,
            bgcolor: 'background.default'
          }
        }}
      >
        <List sx={{ pt: 2 }}>
          {menuItems.map((item) => (
            <ListItem key={item.text} sx={{ px: 2, py: 1 }}>
              <Button
                fullWidth
                component={Link}
                to={item.link}
                onClick={handleDrawerToggle}
                sx={{
                  justifyContent: 'flex-start',
                  color: isActive(item.link) ? 'primary.main' : 'text.primary',
                  bgcolor: isActive(item.link) ? 'primary.light' : 'transparent',
                  '&:hover': {
                    bgcolor: 'primary.light',
                  }
                }}
              >
                {item.text}
              </Button>
            </ListItem>
          ))}
          <ListItem sx={{ px: 2, py: 1 }}>
            <Button
              fullWidth
              variant="contained"
              color="primary"
              sx={{ mt: 2 }}
            >
              Get Started
            </Button>
          </ListItem>
        </List>
      </Drawer>
    </AppBar>
  );
};

export default Navbar;
